const state = {
    ayantdroits : [{
        id: 1
    }, 
    {
        id: 2
    }]
}; 

const getters  ={
    allAyantdroits : (state) => state.ayantdroits

};

const actions = {
    async fetchAyantdroits({commit}){
        const response = await fetch("http://localhost:3000/AyantDroits");
        const res = await response.json();
        commit('fetchAyantdroits', res)
       
    }

};

const mutations = {
    fetchAyantdroits : (state, ayantdroits) => state.ayantdroits = state.ayantdroits

};


export default {
    state, 
    getters, 
    actions, 
    mutations, 

}
